							(SELECT t1.*
								FROM 
								(
									SELECT t.*,if(@ld=t.lead_id,@sl:=@sl+1,@sl:=0) as stg,if(@sl=total_stage-1,stage_id,null) as last_stage_id,@ld:=t.lead_id
